onClipEvent(load){
   var myPoint = {x:this._x,y:this._y};
   _parent.localToGlobal(myPoint);
   _root.gameworld.globalToLocal(myPoint);
   shootX = myPoint.x;
   shootY = myPoint.y;
   兵种库 = ["敌人-暴走改造僵尸","敌人-暴走重型改造僵尸","敌人-暴走兽化改造僵尸","敌人-暴走爆炸僵尸"];
   兵种 = 兵种库[random(兵种库.length)];
   等级 = _parent._parent.等级;
   名字 = "基因变身怪";
   是否为敌人 = _parent._parent.是否为敌人;
   身高 = 175;
   长枪 = "";
   手枪 = "";
   手枪2 = "";
   刀 = "";
   手雷 = "";
   僵尸型敌人newname = _parent._parent._name + 兵种 + random(99);
   _root.gameworld.attachMovie(兵种,僵尸型敌人newname,_root.gameworld.getNextHighestDepth(),{_x:shootX,_y:shootY,等级:this.等级,名字:this.名字,是否为敌人:this.是否为敌人,身高:this.身高,长枪:this.长枪,手枪:this.手枪,手枪2:this.手枪2,刀:this.刀,手雷:this.手雷});
}

onClipEvent(load){
   if(_root.是否阴影 == true)
   {
      this._visible = 1;
   }
   else
   {
      this._visible = 0;
   }
}
